import React from 'react'
import { Route, Routes } from 'react-router-dom'

const Header = (props) => {
  const headerStyle = {
    color: "#fff",
    backgroundColor: "#000"
  }

  return (
    <header>
      <h1 style={headerStyle}>{props.logoText}</h1>
    </header>
  )
}

Header.defaultProps = {
  logoText: "Logo",
}

export default Header
